import React from "react";
import {Link} from "react-router-dom";

import './card-bike.scss'
export default function CardBike(props) {

    return (
        <Link className="cart-bike" to='/products'>
            <img alt="" className="cart-bike__img" src={props.url}/>
            <div className="cart__info">
                <h2 className="cart-bike__title">{props.name}</h2>
                <h4 className="cart-bike__title">{props.price}</h4>
            </div>
        </Link>
    )
}
